func TestConsistentRead(t *testing.T) {
	tmpfile, err := ioutil.TempFile("", "test_consistentread")
	if err != nil {
		t.Fatalf("Can't make temporary file: %v", err)
	}

	// clean up
	defer os.Remove(tmpfile.Name())

	content := []byte(ProcMountsContent)
	if _, err := tmpfile.Write(content); err != nil {
		t.Fatalf("Can't prepare test file for ConsistentRead: %v", err)
	}

	if err := tmpfile.Close(); err != nil {
		t.Fatalf("Can't close temporary file: %v", err)
	}

	result, err := ConsistentRead(tmpfile.Name(), 3)
	if err != nil {
		t.Fatalf("ConsistentRead failed: %v", err)
	}

	if bytes.Compare(content, result) != 0 {
		t.Fatal("Incorrect result for ConsistentRead")
	}
}

func BenchmarkConsistentRead(b *testing.B) {
	tmpfile, err := ioutil.TempFile("", "test_consistentread")
	if err != nil {
		b.Fatalf("Can't make temporary file: %v", err)
	}
	// clean up
	defer os.Remove(tmpfile.Name())

	content := []byte(ProcMountsContent)
	if _, err := tmpfile.Write(content); err != nil {
		b.Fatalf("Can't prepare test file for ConsistentRead: %v", err)
	}

	if err := tmpfile.Close(); err != nil {
		b.Fatalf("Can't close temporary file: %v", err)
	}

	b.ResetTimer()
	// run the ConsistentRead function b.N times
	for n := 0; n < b.N; n++ {
		result, err := ConsistentRead(tmpfile.Name(), 3)
		if err != nil {
			b.Fatalf("ConsistentRead failed: %v", err)
		}

		if bytes.Compare(content, result) != 0 {
			b.Fatal("Incorrect result for ConsistentRead")
		}
	}
}
